import React from 'react'
import Navbar from '../../components/Navbar'
import { useState, useEffect } from 'react';
import { useParams } from 'react-router-dom';

function TicketDetails({user}) {

        let params = useParams()

        const [ticket, setTicket] = useState([])

        useEffect(() => {
            fetch(`/ticket/details/${params.id}`)
            .then(res => res.json())
            .then(data => {
              console.log(data);
             setTicket(data)
            })
         }, [])

         console.log(ticket.comments);

  return (
    <div>
        <Navbar />
        <div className='container'>
            <div className='row pt-4'>
                <div className='card mb-5 h-25 w-50'>
                    <div className='card-header'>Ticket Details</div>
                    <ul class="list-group list-group-flush">
                        <li class="list-group-item pb-3"><strong>Title:</strong> {ticket.title}</li>
                        <li class="list-group-item"><strong>Description:</strong> {ticket.description}</li>
                        <li class="list-group-item"><strong>Priority:</strong> {ticket.priority}</li>
                        <li class="list-group-item"><strong>status:</strong> {ticket.status}</li>
                        <li class="list-group-item"><strong>Type of Bug:</strong> {ticket.type_of}</li>
                    </ul>
                </div>
            </div>
        </div>
    </div>
  )
}

export default TicketDetails
